import React from "react";
import ReactDOM from "react-dom";
import bridge from "@vkontakte/vk-bridge";
import App from "./App";

// Init VK  Mini App
bridge.send('VKWebAppInit')
  .then((data) => { 
    if (data.result) {
      console.log(1)
    } else {
      console.log(2)
    }
  })
  .catch((error) => {
    // Ошибка
    console.log(error);
  });

ReactDOM.render(<App />, document.getElementById("root"));
